actionConfiguration.body:
function (data) {
  const acc = [];
  data.forEach(item => {
    acc.push({
      id: item.id,
      name: item.title,
      img: `${asyncMovies.IMGPATH}${item.poster_path}`,
      vote_average: item.vote_average,
      overview: item.overview
    });
  });
  return acc;
}

